import React from 'react';
import Button from '@material-ui/core/Button';
import DeleteIcon from '@material-ui/icons/Delete';
import Grid from '@material-ui/core/Grid';

const App = props => {
	return (
		<>
			<div className='container'>
				<Grid container>
					<Grid item xs={8}></Grid>
					<Grid item xs={4}>
						<Button
							variant='contained'
							color='secondary'
							startIcon={<DeleteIcon />}
						>
							انجام پروژه
						</Button>
						<Button
							variant='contained'
							color='secondary'
							startIcon={<DeleteIcon />}
						>
							سفارش تایپ
						</Button>
					</Grid>
				</Grid>
			</div>
		</>
	);
};

export default App;
